import React from 'react'
import { Button, Box } from '@mui/material'
import pdfMake from 'pdfmake/build/pdfmake'
import * as pdfFonts from './vfs_fontes'
import { useData } from '../DataContext'

pdfMake.vfs = pdfFonts.default

const styles = {
  header: {
    fontSize: 18,
    bold: true,
    margin: [0, 0, 0, 10],
    color: '#005288',
  },
  subheader: {
    fontSize: 16,
    bold: false,
    margin: [0, 10, 0, 5],
    color: '#005288',
  },
  tableExample: {
    margin: [0, 5, 0, 15],
    borderColor: '#00A4E4',
  },
  tableHeader: {
    bold: true,
    fontSize: 13,
    color: '#005288',
  },
  tableCell: {
    bold: false,
    fontSize: 13,
    color: '#005288',
  },
}

const PdfDocumentMake = () => {
  const {
    applianceGroups,
    totalLoad,
    dailyUsage,
    continuousLoad,
    percentActive,
    doa,
    winterSunHours,
    nameplate,
    minSolar,
    updateCalculationVariable,
    dod,
  } = useData()

  const applianceList = () => {
    return Object.entries(applianceGroups)
      .map(([groupName, appliances]) => {
        return appliances.filter(({ quantity }) => quantity > 0)
      })
      .flat()
  }
  const appliances = applianceList()

  const docDefinition = {
    content: [
      {
        image:
          'data:image/png;base64,',
        fit: [100, 100],
      },
      { text: '\nOff-Grid Load Calculator', style: 'header' },
      {
        style: 'tableExample',
        table: {
          widths: ['*', 40, 60, 60, 80],
          body: [
            [
              { text: 'Appliance', style: 'tableHeader', alignment: 'left' },
              { text: 'Qty', style: 'tableHeader', alignment: 'center' },
              { text: 'Watts', style: 'tableHeader', alignment: 'center' },
              { text: 'Hours', style: 'tableHeader', alignment: 'center' },
              { text: 'Watt Hours', style: 'tableHeader', alignment: 'center' },
            ],
            ...appliances.map((appliance) => {
              return [
                { text: appliance.name, style: 'tableCell', alignment: 'left' },
                { text: appliance.quantity, style: 'tableCell', alignment: 'center' },
                { text: appliance.watts, style: 'tableCell', alignment: 'center' },
                { text: appliance.hours, style: 'tableCell', alignment: 'center' },
                { text: appliance.total, style: 'tableCell', alignment: 'right' },
              ]
            }),
          ],
        },
      },
      {
        style: 'tableExample',
        pageBreak: appliances.length > 21 ? 'before' : 'none',
        table: {
          widths: ['*', 80],
          body: [
            [
              { text: 'Daily kWh usage', style: 'tableHeader', alignment: 'left' },
              { text: `${dailyUsage}kWh`, style: 'tableCell', alignment: 'right' },
            ],
            [
              { text: 'Peak load (total load)', style: 'tableHeader', alignment: 'left' },
              { text: `${totalLoad}kW`, style: 'tableCell', alignment: 'right' },
            ],
            [
              {
                text: 'Percent of appliances on at once',
                style: 'tableHeader',
                alignment: 'left',
              },
              { text: `${percentActive}%`, style: 'tableCell', alignment: 'right' },
            ],
            [
              { text: 'Continuous load', style: 'tableHeader', alignment: 'left' },
              { text: `${continuousLoad} kW`, style: 'tableCell', alignment: 'right' },
            ],
            [
              {
                text: 'Mid winter effective sun hours',
                style: 'tableHeader',
                alignment: 'left',
              },
              { text: `${winterSunHours} hours`, style: 'tableCell', alignment: 'right' },
            ],
            [
              { text: 'Minimum solar PV', style: 'tableHeader', alignment: 'left' },
              { text: `${minSolar} kW`, style: 'tableCell', alignment: 'right' },
            ],
            [
              {
                text: 'Nominated battery depth of discharge (DoD)',
                style: 'tableHeader',
                alignment: 'left',
              },
              { text: `${dod}%`, style: 'tableCell', alignment: 'right' },
            ],
            [
              {
                text: 'Nominated days of autonomy (DoA)',
                style: 'tableHeader',
                alignment: 'left',
              },
              { text: `${doa} days`, style: 'tableCell', alignment: 'right' },
            ],
            [
              {
                text: 'Minimum required battery capacity',
                style: 'tableHeader',
                alignment: 'left',
              },
              { text: `${nameplate}kWh`, style: 'tableCell', alignment: 'right' },
            ],
          ],
        },
      },
    ],
    ...{ styles },
    defaultStyle: {
      // alignment: 'justify'
      //font: 'Times'
    },
  }

}

export default PdfDocumentMake
